	public void showImage(string imageString){
		if (!string.IsNullOrEmpty (imageString)) {
			imageBuffer = System.Convert.FromBase64String (imageString);
			texture.LoadImage (imageBuffer);
			image = (RawImage)gameObject.GetComponent ("RawImage");
